import "./Portfolio.css";

export function Portfolio() {

  let data : PortfolioItem[] = []

  for(let i=0; i< 10; i++) {
    data.push(new PortfolioItem("item $i", "description", "imageUrl", "link"));
  }

  return (
    <div className="portfolio-page flex">
      <div className="portfolio-page-container">
        <div className="portfolio-title section-title">
          Portfolio <span>.</span>
        </div>

        {/* rest of the stuff */}

        {data.map((item) => {
          return (
            <div className="portfolio-item">
              <div className="portfolio-item-image">
                <img src={item.imageUrl}></img>
                </div>
                </div>
          )
        })}
      </div>
    </div>
  );
}

class PortfolioItem {
  title: string;
  description: string;
  imageUrl: string;
  link: string;
  techStack?: string[];

  constructor(
    title: string,
    description: string,
    imageUrl: string,
    link: string,
    techStack?: string[]
  ) {
    this.title = title;
    this.description = description;
    this.imageUrl = imageUrl;
    this.link = link;
    this.techStack = techStack;
  }

  display() {
    return (
      <>
        <div>this.title</div>
        <div>this.description</div>
      </>
    )
  }
}
